import React, { Component } from "react";
import Chart from "react-apexcharts";

export default class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {
      series: [
        {
          name: "series1",
          data: [31, 40, 28, 51, 42, 109, 100],
        },
        {
          name: "series2",
          data: [11, 32, 45, 32, 34, 52, 41],
        },
      ],
      options: {
        chart: {
          height: 350,
          width: 900,
          type: "area",
        },
        dataLabels: {
          enabled: false,
        },
        stroke: {
          curve: "smooth",
        },
        xaxis: {
          type: "datetime",
          categories: [
            "2018-09-19T00:00:00.000Z",
            "2018-09-19T01:30:00.000Z",
            "2018-09-19T02:30:00.000Z",
            "2018-09-19T03:30:00.000Z",
            "2018-09-19T04:30:00.000Z",
            "2018-09-19T05:30:00.000Z",
            "2018-09-19T06:30:00.000Z",
          ],
        },
        chart: {
          width: "100%",
          toolbar: {
            show: false,
          },
        },
      },
    };
  }
  render() {
    return (
      <div className="container-routes">
        <div className="dashboard-content">
          <div className="flexy">
            <label>Overview</label>
            <button>
              Add Funds <div className="additive-icons">+</div>
            </button>
          </div>
          <div className="flexy-dashboard">
            <div className="inherit-content">
              <div className="sub-child-content">
                <div className="chart-content">
                  {/* <Chart
                    options={this.state.options}
                    series={this.state.series}
                    type="area"

                  /> */}
                </div>
                <div className="pie-content"></div>
              </div>
              <div className="sub-child-table">
                <div className="table-content">
                  <table className="table table-bordered datatable">
                    <thead>
                      <tr>
                        <th>S.No</th>
                        <th>Role Name</th>
                        <th>Role Code</th>
                        <th>No.of Menus</th>
                        <th>Created At</th>
                        <th>Status</th>
                        <th>Actions</th>
                      </tr>
                    </thead>
                    <tbody>
                      {countryList.map((country, i) => (
                        <tr key={i}>
                          <td>{i + 1}</td>
                          <td>
                            {returnFirstDegreeObjValue(country, "role_name")}
                          </td>
                          <td>
                            {returnFirstDegreeObjValue(country, "role_code")}
                          </td>
                          <td>{this.handleMenusCount(country, i)}</td>
                          <td>
                            {returnSimpleFormatedDateTime(
                              returnFirstDegreeObjValue(country, "createdAt")
                            )}
                          </td>
                          <td>
                            <div className="radio-status">
                              <input
                                type="radio"
                                className={
                                  country.status === "enable"
                                    ? "status-radio enable-radio"
                                    : "status-radio disable-radio"
                                }
                                checked={true}
                              />{" "}
                              <label className="mt_0_5 text-capitalize">
                                {`${country.status}d`}
                              </label>
                            </div>
                          </td>
                          <td>
                            <div className="action-content">
                              <div
                                className="action"
                                onClick={() =>
                                  this.redirectEditPage(country.role_code)
                                }
                              >
                                Edit
                              </div>
                              <div
                                className="action"
                                onClick={() =>
                                  this.openEnableDisableModal(country, "")
                                }
                              >
                                {country.status === "enable"
                                  ? "Disable"
                                  : "Enable"}
                              </div>
                              <div
                                className="action"
                                onClick={() =>
                                  this.openEnableDisableModal(country, "delete")
                                }
                              >
                                Delete
                              </div>
                            </div>
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              </div>
            </div>
            <div></div>
          </div>
        </div>
      </div>
    );
  }
}
